webpackJsonp([0xe24949714d2d],{363:function(n,a){n.exports={data:{site:{siteMetadata:{navigation:[{path:"/",title:"Media Platform JS SDK"},{path:"/api-reference",title:"API reference"},{path:"/callback-functions",title:"Callback functions"},{path:"/file-management",title:"File Management"},{path:"/archive-files",title:"Create and Extract archive files"},{path:"/images",title:"Images"},{path:"/transcode-video",title:"Transcode video"},{path:"/jobs",title:"Jobs"},{path:"/metadata",title:"Metadata"}]}},page:{frontmatter:{layout:"simple",title:"",include:null},headings:[{depth:2,value:"FileDescriptor"},{depth:2,value:"File Upload"},{depth:3,value:"From Server"},{depth:3,value:"From Browser"},{depth:2,value:"File Import"},{depth:2,value:"Download a Secure File"},{depth:2,value:"List Files in a Directory"},{depth:2,value:"Get File Descriptor"},{depth:2,value:"Get File Metadata"},{depth:2,value:"Delete File"}],html:'<p><a href="https://support.wixmp.com/en/article/file-management" target="_blank" rel="nofollow noopener noreferrer">File Management API Documentation</a>  </p>\n<p>This API provides the basic set of file operations available in Wix Media Platform, such as upload, list and delete.</p>\n<blockquote>\n<p>Please note: for every File Management action, your application needs to have the relevant <a href="https://support.wixmp.com/en/article/about-permissions" target="_blank" rel="nofollow noopener noreferrer">permissions</a>. Add the application to a security group or create a permission that applies to it.</p>\n</blockquote>\n<h2 id="filedescriptor"><a href="#filedescriptor" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>FileDescriptor</h2>\n<p>Each file and folder in WixMP has its corresponding FileDescriptor object, which provides the file\'s ID, hash, path, mime type, size in bytes, ACL, and dates of creation and last update. Several methods in this API return a FileDescriptor object (or array).<br>\nA <code>FileDescriptor</code> has the following properties:</p>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code class="language-javascript"><span class="token keyword">var</span> fileId <span class="token operator">=</span> fileDescriptor<span class="token punctuation">.</span>id<span class="token punctuation">;</span>\n<span class="token keyword">var</span> fileHash <span class="token operator">=</span> fileDescriptor<span class="token punctuation">.</span>hash<span class="token punctuation">;</span>\n<span class="token keyword">var</span> filePath <span class="token operator">=</span> fileDescriptor<span class="token punctuation">.</span>path<span class="token punctuation">;</span>\n<span class="token keyword">var</span> fileMimeType <span class="token operator">=</span> fileDescriptor<span class="token punctuation">.</span>mimeType<span class="token punctuation">;</span>\n<span class="token keyword">var</span> fileType <span class="token operator">=</span> fileDescriptor<span class="token punctuation">.</span>type<span class="token punctuation">;</span>\n<span class="token keyword">var</span> fileSize <span class="token operator">=</span> fileDescriptor<span class="token punctuation">.</span>size<span class="token punctuation">;</span>\n<span class="token keyword">var</span> fileAcl <span class="token operator">=</span> fileDescriptor<span class="token punctuation">.</span>acl<span class="token punctuation">;</span>\n<span class="token keyword">var</span> fileDateCreated <span class="token operator">=</span> fileDescriptor<span class="token punctuation">.</span>dateCreated<span class="token punctuation">;</span>\n<span class="token keyword">var</span> fileDateUpdated <span class="token operator">=</span> fileDescriptor<span class="token punctuation">.</span>dateUpdated<span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<blockquote>\n<p><code>hash</code> and <code>size</code> fields are <code>null</code> for folders.  <code>type</code> field is <code>"-"</code> for files and <code>"d"</code> for directories.</p>\n</blockquote>\n<h2 id="file-upload"><a href="#file-upload" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>File Upload</h2>\n<p>Uploads a file to WixMP by requesting an upload URL and upload token from the application, and performing\na <code>POST</code> request to that URL with the relevant file information.</p>\n<p>First, create an <code>UploadFileRequest</code>. This object defines the uploaded file\'s mime type and ACL.</p>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code class="language-javascript"><span class="token keyword">var</span> UploadFileRequest <span class="token operator">=</span> <span class="token function">require</span><span class="token punctuation">(</span><span class="token string">\'media-platform-js-sdk\'</span><span class="token punctuation">)</span><span class="token punctuation">.</span>file<span class="token punctuation">.</span>UploadFileRequest<span class="token punctuation">;</span>\n\n<span class="token keyword">var</span> uploadRequest <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token class-name">UploadFileRequest</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">.</span><span class="token function">setMimeType</span><span class="token punctuation">(</span>mimeType<span class="token punctuation">)</span><span class="token punctuation">.</span><span class="token function">setAcl</span><span class="token punctuation">(</span>acl<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p><strong>Parameters</strong>:  </p>\n<ul>\n<li>\n<p><code>mimeType</code> (string): for example, <code>"image/jpeg"</code>. If the source file is provided by its path (and not as a stream or buffer), the mime type is determined automatically,\nso you don\'t have to call <code>setMimeType</code>.</p>\n</li>\n<li>\n<p><code>acl</code> (string): can be either <code>"private"</code> or <code>"public"</code> (default value is "public"). </p>\n</li>\n</ul>\n<h3 id="from-server"><a href="#from-server" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>From Server</h3>\n<p>You can provide the source file either by its path (string), or as a buffer or stream.  </p>\n<p>To upload the file:</p>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code class="language-javascript">fileManager<span class="token punctuation">.</span><span class="token function">uploadFile</span><span class="token punctuation">(</span>path<span class="token punctuation">,</span> file<span class="token punctuation">,</span> uploadRequest<span class="token punctuation">,</span> callback<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p><strong>Parameters</strong>:</p>\n<ul>\n<li><code>path</code> (string): the destination path to which the file will be uploaded.</li>\n<li><code>file</code> (string || buffer || stream): the source file to be uploaded (either its path as a string or the file itself as a buffer/stream).</li>\n<li><code>uploadRequest</code> (UploadFileRequest): defines the uploaded file\'s mime type and ACL.</li>\n<li><code>callback</code> (function(error, response)) - a function that handles the HTTP response. On\nsuccess, the callback function is called with an <code>Array&#x3C;FileDescriptor></code> as the <em>response</em> parameter,\nthat includes the uploaded file\'s fileDescriptor.  </li>\n</ul>\n<h3 id="from-browser"><a href="#from-browser" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>From Browser</h3>\n<div class="gatsby-highlight">\n      <pre class="language-html"><code class="language-html"><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>form</span> <span class="token attr-name">id</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>upload-form<span class="token punctuation">"</span></span> <span class="token attr-name">enctype</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>multipart/form-data<span class="token punctuation">"</span></span> <span class="token attr-name">action</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span><span class="token punctuation">"</span></span> <span class="token attr-name">method</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>post<span class="token punctuation">"</span></span> <span class="token attr-name">target</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>upload-result<span class="token punctuation">"</span></span><span class="token punctuation">></span></span>\n    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>input</span> <span class="token attr-name">id</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>file<span class="token punctuation">"</span></span> <span class="token attr-name">name</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>file<span class="token punctuation">"</span></span> <span class="token attr-name">type</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>file<span class="token punctuation">"</span></span><span class="token punctuation">></span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>form</span><span class="token punctuation">></span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>button</span> <span class="token attr-name">id</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>upload-button<span class="token punctuation">"</span></span><span class="token punctuation">></span></span>Upload<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>button</span><span class="token punctuation">></span></span>\n\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>script</span><span class="token punctuation">></span></span><span class="token script language-javascript">\n    <span class="token keyword">var</span> fileUploadButton <span class="token operator">=</span> document<span class="token punctuation">.</span><span class="token function">getElementById</span><span class="token punctuation">(</span><span class="token string">\'upload-button\'</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n    <span class="token keyword">var</span> file <span class="token operator">=</span> document<span class="token punctuation">.</span><span class="token function">getElementById</span><span class="token punctuation">(</span><span class="token string">\'file\'</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n    <span class="token keyword">var</span> path <span class="token operator">=</span> file<span class="token punctuation">.</span>value<span class="token punctuation">.</span><span class="token function">split</span><span class="token punctuation">(</span><span class="token string">"\\\\"</span><span class="token punctuation">)</span><span class="token punctuation">.</span><span class="token function">pop</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n    \n    <span class="token comment">// Optional:</span>\n    <span class="token keyword">var</span> UploadFileRequest <span class="token operator">=</span> <span class="token function">require</span><span class="token punctuation">(</span><span class="token string">\'media-platform-js-sdk\'</span><span class="token punctuation">)</span><span class="token punctuation">.</span>file<span class="token punctuation">.</span>UploadFileRequest<span class="token punctuation">;</span>\n    <span class="token keyword">var</span> uploadRequest <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token class-name">UploadFileRequest</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">.</span><span class="token function">setMimeType</span><span class="token punctuation">(</span><span class="token string">"image/jpeg"</span><span class="token punctuation">)</span><span class="token punctuation">.</span><span class="token function">setAcl</span><span class="token punctuation">(</span><span class="token string">"private"</span><span class="token punctuation">)</span><span class="token punctuation">;</span>    \n    \n    fileUploadButton<span class="token punctuation">.</span><span class="token function">addEventListener</span><span class="token punctuation">(</span><span class="token string">\'click\'</span><span class="token punctuation">,</span> <span class="token keyword">function</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n        mediaPlatform<span class="token punctuation">.</span>fileManager<span class="token punctuation">.</span><span class="token function">uploadFile</span><span class="token punctuation">(</span>path<span class="token punctuation">,</span> file<span class="token punctuation">,</span> uploadRequest<span class="token punctuation">)</span>\n            <span class="token punctuation">.</span><span class="token function">on</span><span class="token punctuation">(</span><span class="token string">\'upload-success\'</span><span class="token punctuation">,</span> <span class="token keyword">function</span><span class="token punctuation">(</span>response<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n                 <span class="token comment">// do something</span>\n            <span class="token punctuation">}</span><span class="token punctuation">)</span>                \n            <span class="token punctuation">.</span><span class="token function">on</span><span class="token punctuation">(</span><span class="token string">\'upload-error\'</span><span class="token punctuation">,</span> <span class="token keyword">function</span><span class="token punctuation">(</span>error<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n                 <span class="token comment">// do something</span>\n            <span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n    <span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n</span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>script</span><span class="token punctuation">></span></span>\n</code></pre>\n      </div>\n<h2 id="file-import"><a href="#file-import" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>File Import</h2>\n<p><a href="https://support.wixmp.com/en/article/file-import" target="_blank" rel="nofollow noopener noreferrer">File Import API documentation</a>  </p>\n<p>Creates a <a href="https://support.wixmp.com/en/article/jobs" target="_blank" rel="nofollow noopener noreferrer">job</a> that imports an existing file from an external URL to the Wix Media Platform file manager.</p>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code class="language-javascript"><span class="token keyword">var</span> ImportFileRequest <span class="token operator">=</span> <span class="token function">require</span><span class="token punctuation">(</span><span class="token string">\'media-platform-js-sdk\'</span><span class="token punctuation">)</span><span class="token punctuation">.</span>file<span class="token punctuation">.</span>ImportFileRequest<span class="token punctuation">;</span>\n\n<span class="token keyword">var</span> importFileRequest <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token class-name">ImportFileRequest</span><span class="token punctuation">(</span><span class="token punctuation">)</span>\n    <span class="token punctuation">.</span><span class="token function">setSourceUrl</span><span class="token punctuation">(</span>url<span class="token punctuation">)</span>\n    <span class="token punctuation">.</span><span class="token function">setExternalAuthorization</span><span class="token punctuation">(</span><span class="token keyword">new</span> <span class="token class-name">ExternalAuthorization</span><span class="token punctuation">(</span><span class="token punctuation">)</span>\n        <span class="token punctuation">.</span><span class="token function">setHeaders</span><span class="token punctuation">(</span>headers<span class="token punctuation">)</span>\n        <span class="token punctuation">.</span><span class="token function">addHeader</span><span class="token punctuation">(</span>name<span class="token punctuation">,</span> value<span class="token punctuation">)</span><span class="token punctuation">)</span>\n    <span class="token punctuation">.</span><span class="token function">setDestination</span><span class="token punctuation">(</span><span class="token keyword">new</span> <span class="token class-name">Destination</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">.</span>\n        <span class="token punctuation">.</span><span class="token function">setPath</span><span class="token punctuation">(</span>path<span class="token punctuation">)</span>\n        <span class="token punctuation">.</span><span class="token function">setAcl</span><span class="token punctuation">(</span>acl<span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\nfileManager<span class="token punctuation">.</span><span class="token function">importFile</span><span class="token punctuation">(</span>importFileRequest<span class="token punctuation">,</span> callback<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p><strong>Parameters</strong>:</p>\n<ul>\n<li><code>url</code> (string) - the external URL to import the file from.</li>\n<li><code>headers</code> (dictionary) - the authorization headers required to authenticate to the external service from which the file is imported.</li>\n<li><code>name, value</code> (string, string) - a key-value pair to be added to the request\'s authorization headers.</li>\n<li><code>path</code> (string) - the destination path for the imported file in Wix Media Platform file manager (example: <code>"/to/file.ext"</code>).</li>\n<li><code>acl</code> (string) - Valid options are <code>"private"</code> or <code>"public"</code>.</li>\n<li><code>callback</code> (function(error, response)) - a function that handles the HTTP response. On success, it\'s called with\nthe <code>Job</code> object that was created.</li>\n</ul>\n<h2 id="download-a-secure-file"><a href="#download-a-secure-file" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Download a Secure File</h2>\n<p>File access can be restricted by setting a file\'s ACL to "private".\nIn order to access these files, a secure URL must be generated.  </p>\n<p>First, create a <code>DownloadUrlRequest</code> object, that determines the URL\'s expiration behavior\nand content disposition header (for more information, see the <a href="https://support.wixmp.com/en/article/file-download" target="_blank" rel="nofollow noopener noreferrer">API documentation</a>.)  </p>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code class="language-javascript"><span class="token keyword">var</span> DownloadUrlRequest <span class="token operator">=</span> <span class="token function">require</span><span class="token punctuation">(</span><span class="token string">\'media-platform-js-sdk\'</span><span class="token punctuation">)</span><span class="token punctuation">.</span>file<span class="token punctuation">.</span>DownloadUrlRequest<span class="token punctuation">;</span>\n\n<span class="token keyword">var</span> downloadUrlRequest <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token class-name">DownloadUrlRequest</span><span class="token punctuation">(</span><span class="token punctuation">)</span>\n                            <span class="token punctuation">.</span><span class="token function">setTTL</span><span class="token punctuation">(</span>ttl<span class="token punctuation">)</span>\n                            <span class="token punctuation">.</span><span class="token function">setAttachment</span><span class="token punctuation">(</span>filename<span class="token punctuation">)</span>\n                            <span class="token punctuation">.</span><span class="token function">setOnExpireRedirectTo</span><span class="token punctuation">(</span>onExpireRedirectTo<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p><strong>Parameters</strong>:</p>\n<ul>\n<li><code>ttl</code> (integer) - the token time to live in seconds.</li>\n<li><code>filename</code> (string) - Content-Disposition header, if provided the content disposition is set to attachment with the provided file name.</li>\n<li><code>onExpireRedirectTo</code> (string) - if the token expired, the page will redirect to this URL.</li>\n</ul>\n<p>To get the download URL:</p>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code class="language-javascript"><span class="token keyword">var</span> downloadUrl <span class="token operator">=</span> mediaPlatform<span class="token punctuation">.</span><span class="token function">getDownloadUrl</span><span class="token punctuation">(</span>path<span class="token punctuation">,</span> downloadUrlRequest<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p><strong>Parameters</strong>:</p>\n<ul>\n<li><code>path</code> (string) - the requested file\'s path in WixMP file manager (example: <code>"path/to/file.ext"</code>).</li>\n<li><code>downloadUrlRequest</code> (DownloadUrlRequest) - as described above.</li>\n</ul>\n<h2 id="list-files-in-a-directory"><a href="#list-files-in-a-directory" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>List Files in a Directory</h2>\n<p>Retrieves a list of the files in the specified directory.\nFirst, create a <code>ListFilesRequest</code>, which determines the query\'s parameters, as follows:</p>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code class="language-javascript"><span class="token keyword">var</span> ListFilesRequest <span class="token operator">=</span> <span class="token function">require</span><span class="token punctuation">(</span><span class="token string">\'media-platform-js-sdk\'</span><span class="token punctuation">)</span><span class="token punctuation">.</span>file<span class="token punctuation">.</span>ListFilesRequest<span class="token punctuation">;</span>\n\n<span class="token keyword">var</span> listFilesRequest <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token class-name">ListFilesRequest</span><span class="token punctuation">(</span><span class="token punctuation">)</span>\n    <span class="token punctuation">.</span><span class="token function">setNextPageToken</span><span class="token punctuation">(</span>nextPageToken<span class="token punctuation">)</span>\n    <span class="token punctuation">.</span><span class="token function">setPageSize</span><span class="token punctuation">(</span>pageSize<span class="token punctuation">)</span>\n    <span class="token punctuation">.</span><span class="token function">setOrderBy</span><span class="token punctuation">(</span>orderBy<span class="token punctuation">)</span>\n    <span class="token punctuation">.</span><span class="token function">ascending</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<blockquote>\n<p>You can choose between calling <code>ascending()</code> and <code>descending()</code> to define the list\'s order direction.\nThe list is provided in a descending order by default.  </p>\n</blockquote>\n<p><strong>Parameters</strong>: </p>\n<ul>\n<li><code>nextPageToken</code> (string) - optional. The next page cursor, as provided in a previous <code>listFiles</code> response.</li>\n<li><code>pageSize</code> (integer) - optional. Defaults to 20.</li>\n<li><code>orderBy</code> (OrderBy) - optional. <code>name</code> or <code>date</code>, defaults to <code>date</code>.</li>\n<li><code>directory</code> (string) - the required directory (example: <code>"/images/"</code>).</li>\n</ul>\n<p>To request the files:</p>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code class="language-javascript">fileManager<span class="token punctuation">.</span><span class="token function">listFiles</span><span class="token punctuation">(</span>directory<span class="token punctuation">,</span> listFilesRequest<span class="token punctuation">,</span> callback<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p><strong>Parameters</strong>: </p>\n<ul>\n<li><code>directory</code> (string) - the path of the required directory (example: <code>"/images/"</code>).</li>\n<li><code>listFilesRequest</code> (ListFilesRequest) - as described above.</li>\n<li>\n<p><code>callback</code> (function(error, response)) - a function that handles the HTTP response. On success, it\'s called with\na <code>ListFilesResponse</code> object, which has the following properties:</p>\n<ul>\n<li><code>.nextPageToken</code> (string) - can be passed as a parameter to the <code>setNextPageToken</code> method.</li>\n<li><code>.files</code> (Array&#x3C;FileDescriptor>) - the fileDescriptor objects of the files in the specified directory.</li>\n</ul>\n</li>\n</ul>\n<h2 id="get-file-descriptor"><a href="#get-file-descriptor" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Get File Descriptor</h2>\n<p>Retrieves a file\'s <a href="https://support.wixmp.com/en/article/file-management#filedescriptor-object" target="_blank" rel="nofollow noopener noreferrer">fileDescriptor</a> object by path.</p>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code class="language-javascript">fileManager<span class="token punctuation">.</span><span class="token function">getFile</span><span class="token punctuation">(</span>path<span class="token punctuation">,</span> callback<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p><strong>Parameters</strong>: </p>\n<ul>\n<li><code>path</code> (string) - the path of the required file (example: <code>"/images/porcupine.jpg"</code>).</li>\n<li><code>callback</code> (function(error, response)) - a function that handles the HTTP response. On success, it\'s called with\nthe requested <code>FileDescriptor</code> object.</li>\n</ul>\n<h2 id="get-file-metadata"><a href="#get-file-metadata" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Get File Metadata</h2>\n<p><a href="https://support.wixmp.com/en/article/file-metadata" target="_blank" rel="nofollow noopener noreferrer">File Metadata API Documentation</a>  </p>\n<p>Retrieves a file\'s <a href="https://support.wixmp.com/en/article/file-metadata#metadata-objects" target="_blank" rel="nofollow noopener noreferrer">metadata object</a>\nby its file ID.</p>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code class="language-javascript">fileManager<span class="token punctuation">.</span><span class="token function">getFileMetadataById</span><span class="token punctuation">(</span>fileId<span class="token punctuation">,</span> callback<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p><strong>Parameters</strong>: </p>\n<ul>\n<li><code>fileId</code> (string) - the required file\'s ID.</li>\n<li><code>callback</code> (function(error, response)) - a function that handles the HTTP response. On success, it\'s called with\nthe requested <code>FileMetadata</code> object.</li>\n</ul>\n<h2 id="delete-file"><a href="#delete-file" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Delete File</h2>\n<p>Deletes a file by either file ID or path.</p>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code class="language-javascript">fileManager<span class="token punctuation">.</span><span class="token function">deleteFileById</span><span class="token punctuation">(</span>id<span class="token punctuation">,</span> callback<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p><strong>Parameters</strong>: </p>\n<ul>\n<li><code>fileId</code> (string) - the file ID of the file to be deleted.  </li>\n<li><code>callback</code> (function(error, response)) - a function that handles the HTTP response. This callback is only called on error,\nas a success result is returns <code>null</code>.</li>\n</ul>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code class="language-javascript">fileManager<span class="token punctuation">.</span><span class="token function">deleteFileByPath</span><span class="token punctuation">(</span>path<span class="token punctuation">,</span> callback<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p><strong>Parameters</strong>: </p>\n<ul>\n<li><code>path</code> (string) - the path of the file to be deleted.  </li>\n<li><code>callback</code> (function(error, response)) - a function that handles the HTTP response. This callback is only called on error,\nas a success result is returns <code>null</code>.</li>\n</ul>'
}},pathContext:{slug:"/file-management/"}}}});
